import React, { useState } from 'react';
import MilkenForm from './components/MilkenForm';
import './App.css';

function App() {
  return (
    <div className="app">
      <header className="app-header">
        <div className="header-logos">
          <div className="logo-milken">
            <div className="milken-icon">✦</div>
            <span>MILKEN<br/>INSTITUTE</span>
          </div>
          <div className="logo-sfda">
            <div className="sfda-circle">SFDA</div>
            <span>الهيئة العامة للغذاء والدواء</span>
          </div>
        </div>
        <h1>مولّد تقرير PDF — مؤتمر معهد ميلكن العالمي 2025</h1>
        <p>Milken Institute Global Conference 2025 — PDF Report Generator</p>
      </header>
      <main>
        <MilkenForm />
      </main>
    </div>
  );
}

export default App;
